import React from 'react'

const Workers = ({workers}) => {
    return (
        <div className="flights">
          {workers.slice(0, 3).map((p) => (
            <div className="name" key={workers.id}><h4>{p.name}</h4></div>
          ))}  
        </div>
    )
}

export default Workers
